I found some similar errors thrown by CUBLAS and cuFFT and it was due to this tensorflow 2.0 memory growth problem https://www.tensorflow.org/guide/gpu#limiting_gpu_memory_growth

Adding this code before training and evaluating fixed it:

```python
gpus = tf.config.experimental.list_physical_devices('GPU')
if gpus:
  try:
    for gpu in gpus:
      tf.config.experimental.set_memory_growth(gpu, True)
    logical_gpus = tf.config.experimental.list_logical_devices('GPU')
    print(len(gpus), "Physical GPUs,", len(logical_gpus), "Logical GPUs")
  except RuntimeError as e:
    print(e)
```
